(()=>{"use strict";const e=e=>{if(e<2)return!1;for(let t=2;t<e;t++)if(e%t==0)return!1;return!0};let t=document.getElementById("min"),n=document.getElementById("max"),r=document.getElementById("console");document.getElementById("findPrimes").addEventListener("click",(async function(){console.log("finding primes...");let i=+t.value,l=+n.value,o=await function(t,n){return new Promise(((r,i)=>{setTimeout((()=>{if(t>=n)return i(new Error(`Invalid range ${t}-${n}`));let l=[];for(let r=t;r<n;r++)e(r)&&l.push(r);r(l)}),10)}))}(i,l);r.innerHTML+=`<p>total primes between ${i}-${l} is ${o.length}`}))})();